s para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"2234","type":"Paragraph"},{"attributes":{"data_source":{"id":"2121"},"glyph":{"id":"2122"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"2123"},"selection_glyph":null,"view":{"id":"2125"}},"id":"2124","type":"GlyphRenderer"},{"attributes":{"axis_label":"Casos Acumulados","formatter":{"id":"1890"},"ticker":{"id":"1866"}},"id":"1865","type":"LinearAxis"},{"attributes":{"label":{"value":"50% do valor Normal"},"renderers":[{"id":"2096"}]},"id":"2120","type":"LegendItem"},{"attributes":{"data_source":{"id":"1883"},"glyph":{"id":"1884"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1885"},"selection_glyph":null,"view":{"id":"1887"}},"id":"1886","type":"GlyphRenderer"},{"attributes":{"below":[{"id":"1861"}],"center":[{"id":"1864"},{"id":"1868"},{"id":"1906"},{"id":"2003"}],"left":[{"id":"1865"}],"plot_height":320,"renderers":[{"id":"1886"},{"id":"1911"},{"id":"1916"},{"id":"1944"},{"id":"1974"},{"id":"2011"}],"title":{"id":"1851"},"toolbar":{"id":"1876"},"x_range":{"id":"1853"},"x_scale":{"id":"1857"},"y_range":{"id":"1855"},"y_scale":{"id":"1859"}},"id":"1850","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"2104","type":"Selection"},{"attributes":{},"id
